import { Footer } from "./../components/footer";
import { Logo } from "./../components/Logo";
import React from "react";
import { bruh, bruh_lunch } from "../tmp";
import { Tabs, TabList, Tab, TabPanel } from "@mui/joy";

export function Menu({}) {
    console.log(bruh)
    console.log(bruh_lunch)
  return (
    <div>
      <div className="p-[4rem] h-screen w-full flex flex-col justify-center items-center">
        <Logo />
        <div className="mt-[20rem] w-full flex justify-center">
          <Tabs
            aria-label="Basic tabs"
            defaultValue={0}
            size="lg"
            className="w-full md:w-[75%] h-[35rem] "
            orientation="horizontal"
            sx={{ backgroundColor: "white" }}
          >
            <TabList className="flex justify-center">
              <Tab sx={{ color: "#3F4E58" }}>Breakfast</Tab>
              <Tab sx={{ color: "#3F4E58" }}>Lunch</Tab>
              <Tab sx={{ color: "#3F4E58" }}>Dinner</Tab>
            </TabList>
            <TabPanel value={0}>
              <h2>{bruh[0]}</h2>
              {bruh[1].map((section, i) => {
                return <h3>{section.name.slice(0,-1)} test</h3>
              })}
            </TabPanel>
            <TabPanel value={1}>
              <b>Second</b> tab panel
            </TabPanel>
            <TabPanel value={2}>
              <b>Third</b> tab panel
            </TabPanel>
          </Tabs>
        </div>
      </div>

      <Footer />
    </div>
  );
}
